document.addEventListener('DOMContentLoaded', () => {
  const encryptedContent = '';

  const scripts = [
    '/scripts/index.js'
  ];

  async function loadScript(src) {
    return new Promise((resolve, reject) => {
      const script = document.createElement('script');

      script.src = src;
      script.onload = resolve;
      script.onerror = reject;

      document.body.appendChild(script);
    });
  }

  async function loadScriptsSequentially(scripts) {
    for (const src of scripts) {
      await loadScript(src);
    }
  }

  async function decryptContent(password) {
    try {
      const decrypted = CryptoJS.AES.decrypt(encryptedContent, password);
      const content = decrypted.toString(CryptoJS.enc.Utf8);

      if (!content) throw new Error('Decryption failed');

      return content;
    } catch (e) {
      return null;
    }
  }

  async function requestPassword() {
    const password = prompt('암호를 입력하세요.');
    const content = await decryptContent(password);

    if (content) {
      document.body.innerHTML = content;

      await loadScriptsSequentially(scripts);
    } else {
      alert('암호가 잘못되었습니다. 접근이 차단됩니다.');
    }
  }

  requestPassword();
});
